import Colaborador from '../Colaborador'
import './Time.css'

const Time = (props) => {
    const secundaria = { backgroundColor: props.corSecundaria }
    return (
        (props.colaboradores.length > 0) ? 
            <section className='time' style={secundaria}>
                <h3 style={{ borderColor: props.corPrimaria }}>{props.nome}</h3>
                <div className='colaboradores'>
                    {props.colaboradores.map(colaborador =>{
                        console.log(<Colaborador corDefundo={props.corPrimaria} key={colaborador.nome}
                            nome={colaborador.nome}
                            cargo={colaborador.cargo}
                            imagem={colaborador.imagem}
                        />);
                        return <Colaborador corDefundo={props.corPrimaria} key={colaborador.nome}
                        nome={colaborador.nome}
                        cargo={colaborador.cargo}
                        imagem={colaborador.imagem}
                    />
                    } )}
                </div>
            </section>
        : ''
    )
}



export default Time
